Este soneto satírico fue escrito por Lope de Vega, quien vivió entre 1562 y 1635. El poema hace referencia a la actriz Josefa Vaca y su marido, el actor Juan de Morales Medrano, personajes conocidos del teatro del Siglo de Oro español.
